    console.log("ActivityOne", ActivityOne.default);
    this.state = {
      numPages: null,
      pageNumber: 1,
    };
  }

  onDocumentLoadSuccess = ({ numPages }) => {
    this.setState({ numPages });
  }
  componentDidMount() {
    //this.setState({ Activity: ActivityOne.default });
  }

  render() {
    const { pageNumber, numPages } = this.state;

    return (
      <div>
        <div className="row">
          <div className="col s12">
          <ActivityCard data={CapacityTalk.default} />

          </div>
          </div>
          <div className = "row"> 
